import React from 'react'

function Reviews( {reviews} ) {

  return (
    <div>
        <h2 className='second'>User Reviews</h2>
        {reviews.map(review => (
            <div>

                <ul  className="second" >
                    <li key={review.id}>{review.comment}</li>
                </ul>
            </div>
        ))}
    </div>
    )
}

export default Reviews
